//水印自适应函数
function watermarkAdaptive(host){
    
    var tempwidth=0;
    var tempheight=0;
    var height = document.body.offsetHeight;
    var width  = document.body.offsetWidth;
    var watermarkImg = document.getElementById("watermarkImg");
    if(watermarkImg){
        if(height<width){
            if(height <= 190){
                tempwidth=190*0.1*3.3;
                tempheight=190*0.1;
                watermarkImg.style.width=String(tempwidth.toFixed(0))+'px';
                watermarkImg.style.height=String(tempheight.toFixed(0))+'px';
            }
            else{
                tempwidth=height*0.1*3.3;
                tempheight=height*0.1;
                watermarkImg.style.width=String(tempwidth.toFixed(0))+'px';
                watermarkImg.style.height=String(tempheight.toFixed(0))+'px';
            }
        }
        else{
            if(width <= 270){
                tempwidth=270*0.22;
                tempheight=270*0.22/3.3;
                watermarkImg.style.width=String(tempwidth.toFixed(0))+'px';
                watermarkImg.style.height=String(tempheight.toFixed(0))+'px';
            }else{
                tempwidth=width*0.33;
                tempheight=width*0.33/3.3;
                watermarkImg.style.width=String(tempwidth.toFixed(0))+'px';
                watermarkImg.style.height=String(tempheight.toFixed(0))+'px';
            }
        }
    }
    else{
        var mask_div = document.createElement('div');
        mask_div.onclick=function(){
            host.launchUrl("http://www.sharewinfo.com/Productsummary.html");
        }
        var mask_a = document.createElement('a');
        var mask_img = document.createElement('img');
        mask_div.setAttribute("id","watermarkDiv");
        mask_img.setAttribute("id","watermarkImg");
        mask_a.setAttribute("href","http://www.sharewinfo.com/Productsummary.html");
        mask_img.setAttribute("src","data:image/png;base64,");

        mask_a.appendChild(mask_img);
        mask_div.appendChild(mask_a);
        mask_div.style.position="absolute";
        mask_div.style.bottom="-5px";
        mask_div.style.right="0px";
        mask_img.style.width="80px";
        mask_img.style.height="25px";
        document.body.appendChild(mask_div);
    }
  
}